import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 54.1-3439 Application for nonrestricted manufacturing permit; fee.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-3439.md","filePath":"vacode/54.1-3439.md"}'),i={name:"vacode/54.1-3439.md"},n=t('<h1 id="§-54-1-3439-application-for-nonrestricted-manufacturing-permit-fee" tabindex="-1">§ 54.1-3439 Application for nonrestricted manufacturing permit; fee. <a class="header-anchor" href="#§-54-1-3439-application-for-nonrestricted-manufacturing-permit-fee" aria-label="Permalink to &quot;§ 54.1-3439 Application for nonrestricted manufacturing permit; fee.&quot;">​</a></h1><p>Every person desiring to manufacture any drug or proprietary medicines shall annually apply to the Board for a nonrestricted manufacturing permit. The application shall be accompanied by the required fee. Separate applications shall be made and separate permits issued for each specific place of manufacturing. Each such permit shall expire annually on a date determined by the Board in regulation.</p><p>1970, c. 650, § 54-524.40; 1972, c. 798; 1976, c. 614; 1980, c. 288; 1988, c. 765; 1996, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0037" target="_blank" rel="noreferrer">37</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0407" target="_blank" rel="noreferrer">407</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0320" target="_blank" rel="noreferrer">320</a>.</p>',3),o=[n];function c(p,l,s,f,d,u){return a(),r("div",null,o)}const h=e(i,[["render",c]]);export{m as __pageData,h as default};
